import React from "react";
import {
  Text,
  StyleSheet,
  View,
  ImageBackground,
  TouchableOpacity,
  Button,
} from "react-native";

const WelcomeScreen = ({ navigation }) => {
  return (
    <ImageBackground
      style={styles.background}
      source={{
        uri: "https://source.unsplash.com/featured/?abstract,background,white",
      }}
    >
      <View style={styles.overlay}>
        <TouchableOpacity style={styles.button}> Go to Home </TouchableOpacity>
        <TouchableOpacity style={styles.button}> See List </TouchableOpacity>
      </View>
    </ImageBackground>
  );
};

const styles = StyleSheet.create({
  background: {
    flex: 1,
  },

  overlay: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    margin: 20,
  },
  button: {
    margin: 20,
    padding: 10,
  },
});
export default WelcomeScreen;
